void loadModel( ){ 
	static bool loaded = false;

	if ( loaded ) {
		return;
	}

	goalPostF_dispList = glGenLists( 1 );
	goalPostN_dispList = glGenLists( 1 );
	guardRailR_dispList = glGenLists( 1 );
	guardRailL_dispList = glGenLists( 1 );
	board_dispList = glGenLists( 1 );

	glNewList( goalPostF_dispList, GL_COMPILE );
	load_0();	
	glEndList( );

	glNewList( goalPostN_dispList, GL_COMPILE );
	load_1();	
	glEndList( );

	glNewList( guardRailR_dispList, GL_COMPILE );
	load_2();	
	glEndList( );

	glNewList( guardRailL_dispList, GL_COMPILE );
	load_3();	
	glEndList( );

	glNewList( board_dispList, GL_COMPILE );
	load_4();	
	glEndList( );

	loaded = true;

	return; 
}


void drawModel( ){ 
	GLfloat mat_ambient[] = { 0.2, 0.4, 0.4, 1.0 };
	GLfloat mat_diffuse[] = { 0.2, 0.4, 0.4, 1.0 };
	GLfloat mat_specular[] = { 1.0, 1.0, 1.0, 1.0 };
	GLfloat mat_shininess[] = { 1.0 };

	glMaterialfv(GL_FRONT, GL_AMBIENT, mat_ambient);
	glMaterialfv(GL_FRONT, GL_DIFFUSE, mat_diffuse);
	glMaterialfv(GL_FRONT, GL_SPECULAR, mat_specular);
	glMaterialfv(GL_FRONT, GL_SHININESS, mat_shininess);

	glCallList( goalPostN_dispList );
	glCallList( goalPostF_dispList );
	glCallList( guardRailR_dispList );
	glCallList( guardRailL_dispList );
	glCallList( board_dispList );

	return; 
}
